Then $BD = \frac{x}{3/2} = \frac{2x}{3},$ and $CD = \frac{x}{1/2} = 2x,$ so
\[BC = BD + DC = \frac{2x}{3} + 2x = \frac{8x}{3}.\]Since $BC = 32,$ $x = 12.$

Therefore, $[ABC] = \frac{1}{2} \cdot AD \cdot BC = \frac{1}{2} \cdot 12 \cdot 32 = .$

question:
Five points $A$, $B$, $C$, $D$, and $O$ lie on a flat field.  $A$ is directly north of $O$, $B$ is directly west of $O$, $C$ is directly south of $O$, and $D$ is directly east of $O$. The  distance between $C$ and $D$ is 140 m.  A hot-air balloon is positioned in the air at $H$ directly above $O$. The balloon is held in place by four ropes $HA$, $HB$, $HC$, and $HD$.  Rope $HC$ has length 150 m and rope $HD$ has length 130 m. [asy]
size(250);
pair A, B, C, D, O, H, W, X, Y, Z;
O=(0,0);
A=(1,1);
D=(1.5,-.3);
B=(-1.5,.3);
C=(-1,-1);
H=(0,2.5);
W=(5/3)*(A+D);
X=(5/3)*(A+B);
Y=(-1)*(W);
Z=(-1)*(X);
draw(W--X--Y--Z--W);
draw(A--C);
draw(B--D);
draw(O--H, linewidth(1));
draw(A--H, dashed);
draw(B--H, dashed);
draw(C--H, dashed);
draw(D--H, dashed);
dot(A);
dot(B);
dot(C);
dot(D);
dot(O);
dot(H);
label("A", A, NE);
label("B", B, SW);
label("C", C, SE);
label("D", D, NE);
label("O", O, SE);
label("H", H, NW);
[/asy]

To reduce the total length of rope used, rope $HC$ and rope $HD$ are to be replaced by a single rope $HP$ where $P$ is a point on the straight line between $C$ and $D$. (The balloon remains at the same position $H$ above $O$ as described above.)  Determine the greatest length of rope that can be saved.

rationale:
To save the most rope, we must have $HP$ having minimum length.
For $HP$ to have minimum length, $HP$ must be perpendicular to $CD$. [asy]
pair C, D, H, P;
H=(90,120);
C=(0,0);
D=(140,0);
P=(90,0);
draw(H--C--D--H--P);
label("H", H, N);
label("C", C, SW);
label("D", D, SE);
label("P", P, S);
label("150", (C+H)/2, NW);
label("130", (D+H)/2, NE);
[/asy] (Among other things, we can see from this diagram that sliding $P$ away from the perpendicular position does make $HP$ longer.)
In the diagram, $HC=150$, $HD=130$ and $CD=140$.
Let $HP=x$ and $PD=a$.  Then $CP=140-a$.
By the Pythagorean Theorem in $\triangle HPC$, $x^2 + (140-a)^2 = 150^2$.
By the Pythagorean Theorem in $\triangle HPD$, $x^2+a^2 = 130^2$.
Subtracting the second equation from the first, we obtain \begin{align*}
(140-a)^2 - a^2 & = 150^2 - 130^2 \\
(19600 - 280a+a^2)-a^2 & = 5600 \\
19600 -280a & = 5600 \\
280a & = 14000 \\
a & = 50
\end{align*} Therefore, $x^2 + 90^2 = 150^2$ or $x^2 = 150^2 - 90^2 = 22500 - 8100 = 14400$ so $x =120$.
So the shortest possible rope that we can use is 120 m, which saves $130+150-120 = $ m of rope.

question:
Below is the graph of $y = a \cos bx$ for some positive constants $a$ and $b.$  Find $b.$

[asy]import TrigMacros;

size(400);

real g(real x)
{
	return (3*cos(4*x));
}

draw(graph(g,-3*pi,3*pi,n=700,join=operator ..),red);
trig_axes(-3*pi,3*pi,-4,4,pi/2,1);
layer();
rm_trig_labels(-5, 5, 2);

label("$1$", (0,1), E);
label("$2$", (0,2), E);
label("$3$", (0,3), E);
label("$-1$", (0,-1), E);
label("$-2$", (0,-2), E);
label("$-3$", (0,-3), E);
[/asy]

rationale:
[asy]
defaultpen(linewidth(.8));
draw((2,0)--(0,0)--(0,1),dashed);
draw((0,1)--(0,2.75)--(3,2.75));
draw((3,2.75)--(4.25,2.75)--(4.25,2),dashed);
draw((3,2.75)--(3,2)--(4.25,2)--(4.25,0)--(2,0)--(2,1)--(0,1));
label("7''",(0,1.875),E);
label("12''",(1.5,2.75),N);
label("3''",(3,2.375),E);
label("8''",(1,1),S);
label("4''",(2,.5),W);
label("9''",(3.125,0),N);
label("5''",(3.75,2),N);
[/asy]

Notice that there are two rectangular holes in the top right corner and the bottom left corner. If these holes were filled, the entire figure would be a rectangle with length $8+9=17$ inches and width $7+4=11$ inches. The area would be $17\cdot11=187$ square inches. The area of the top right hole is $5\cdot3=15$ square inches and the area of the bottom left hole is $8\cdot4=32$ square inches. The area of the given figure is the area of the large rectangle minus the areas of the two holes, or $187-15-32=$ square inches.

We begin by drawing a diagram and labeling the vertices $A$, $B$, and $C$ as shown:

[asy]
pair A, B, C;
A=(0,0); B=(17,0); C=(5,12);
draw(A--B--C--cycle);
label("$A$",A,W); label("$B$",B,E); label("$C$",C,N);
label("$13$",(A+C)/2,NW); label("$12\sqrt{2}$",(B+C)/2,NE); label("$17$",(A+B)/2,S);
[/asy]

We drop a perpendicular from $C$ to $\overline{AB}$ and label the intersection point $X$. $X$ divides $AB$ into two segments $AX$ and $XB$ that sum to 17, so let $AX=x$ and $XB=17-x$.  Let the height of the triangle, $CX$, have length $h$.

[asy]
pair A, B, C, X;
A=(0,0); B=(17,0); C=(5,12); X=(5,0);
draw(A--B--C--cycle); draw(C--X);
label("$A$",A,W); label("$B$",B,E); label("$C$",C,N); label("$X$",X,S);
label("$13$",(A+C)/2,NW); label("$12\sqrt{2}$",(B+C)/2,NE); label("$x$",(A+X)/2,S); label("$17-x$",(B+X)/2,S);
label("$h$",(C+X)/2,E);
draw(rightanglemark(C,X,B,20));
[/asy]

Now we have two right triangles, so we can use the Pythagorean theorem on both triangles to write two equations in terms of $x$ and $h$.  From $\triangle AXC$, we have \[x^2+h^2=13^2,\] and from $\triangle CXB$, we have \[(17-x)^2+h^2=(12\sqrt{2})^2.\] Expanding the second equation gives $289-34x+x^2+h^2=144\cdot 2 = 288$; substituting the first equation into the second gives \[289-34x+13^2=288.\] Simplifying and solving for $x$ yields $1+169=34x$, so $x=170/34=5$.  Plugging this value into the first equation gives \[h^2=13^2-x^2=169-25=144,\] so $h=\sqrt{144}=12$.  Finally, we can compute the area of $\triangle ABC$ to be \[\frac{1}{2}(AB)(h)=\frac{1}{2}(17)(12)=.\]

The midpoints of the diagonals of a square coincide, so the midpoint of the line segment joining (7,9) and (10,2) is the same as the midpoint of the line segment joining the other two vertices of the square.  The average of the $y$-coordinates of (7,9) and (10,2) is the $y$-coordinate of their midpoint, which in turn is also equal to the average of the $y$-coordinates of the missing vertices.  Therefore, the average of the $y$-coordinates of (7,9) and (10,2) is equal to the average of the $y$-coordinates of the two missing vertices.  Since the sum is twice the average, the sum of the $y$-coordinates of the missing vertices is the same as that of the given vertices: $9+2=$.

[asy]
unitsize(0.5 cm);

pair A, B, C, D, O;

A = (7,9);
C = (10,2);
O = (A + C)/2;
B = rotate(90,O)*(A);
D = rotate(90,O)*(C);

draw(A--B--C--D--cycle);
draw(A--C);
draw(B--D);

dot("$(7,9)$", A, N);
dot("$(10,2)$", C, S);
dot(O);
[/asy]

We can line up the numbers and subtract just as we do in base 10.  For example, when we borrow from the $3^1$s place, the digit 1 in the units place becomes $4$, while the digit in the $3^1$s place decreases by 1. Continuing in this way, we find $$\begin{array}{c@{}c@{}c@{}c@{}c}
& \cancelto{1}{2} & \cancelto{4}{1} & \cancelto{1}{2} & \cancelto{4}{1}_3 \\
-& & 2 & 1 & 2_3 \\
\cline{2-5}
& 1 & 2 & 0 & 2_3 \\
\end{array}$$So the difference is $$.

