rationale:
Let $F_1=(7,0)$ and $F_2=(-7,0)$ be the two foci. We know that if the hyperbola has equation \[\frac{x^2}{a^2} - \frac{y^2}{b^2} = 1,\]then for any point $P$ on the hyperbola, we have $|PF_1 - PF_2| = 2a.$ We are given that the point $P=(2,12)$ lies on the hyperbola. We have $PF_1 = \sqrt{(7-2)^2 + (12-0)^2} = 13$ and $PF_2 = \sqrt{(-7-2)^2 + (12-0)^2} = 15,$ so $|PF_1 - PF_2| = |13-15| = 2.$ Thus, $2 = 2a,$ so $a = 1.$

Now, the distance from the center of the hyperbola (the origin) to each focus is $7,$ so we have $a^2 + b^2 = 7^2 = 49.$ Substituting $a=1,$ we get $1 + b^2 = 49,$ so $b = \sqrt{48} = 4\sqrt{3}.$ Thus, $(a, b) = .$
[asy]
void axes(real x0, real x1, real y0, real y1, real ys=1)
{
	draw((x0,0)--(x1,0),EndArrow);
    draw((0,y0*ys)--(0,y1*ys),EndArrow);
    label("$x$",(x1,0),E);
    label("$y$",(0,y1*ys),N);
    for (int i=floor(x0)+1; i<x1; ++i)
    	draw((i,.1)--(i,-.1));
    for (int i=floor(y0)+1; i<y1; ++i)
    	draw((.1,i*ys)--(-.1,i*ys));
}
path[] yh(real a, real b, real h, real k, real x0, real x1, bool upper=true, bool lower=true, pen color=black , real ys=1)
{
	real f(real x) { return k + a / b * sqrt(b^2 + (x-h)^2); }
    real g(real x) { return k - a / b * sqrt(b^2 + (x-h)^2); }
    if (upper) { draw(xscale(ys)*graph(f, x0, x1),color,  Arrows); }
    if (lower) { draw(xscale(ys)*graph(g, x0, x1),color,  Arrows); }
    path [] arr = {xscale(ys)*graph(f, x0, x1), xscale(ys)*graph(g, x0, x1)};
    return arr;
}
void xh(real a, real b, real h, real k, real y0, real y1, bool right=true, bool left=true, pen color=black , real ys=1)
{
	path [] arr = yh(a, b, k, h, y0, y1, false, false, ys);
    if (right) draw(reflect((0,0),(1,1))*arr[0],color,  Arrows);
    if (left) draw(reflect((0,0),(1,1))*arr[1],color,  Arrows);
}
void e(real a, real b, real h, real k)
{
	draw(shift((h,k))*scale(a,b)*unitcircle);
}
