dot("$F_2$",(0,-1/sqrt(2)),SW);
[/asy] The existence of such a circle implies that the origin is equidistant from each focus and each endpoint of the horizontal (minor) axis. Therefore, we have \[\frac{\sqrt{k-1}}{\sqrt{k}} = \frac{1}{\sqrt{k}},\]so $\sqrt{k-1} = 1.$ Thus, $k-1=1,$ and $k=.$

