Since the small triangle is equilateral, $d - e = \operatorname{cis} 60^\circ \cdot (f - e),$ or
\[d - e = \frac{1 + i \sqrt{3}}{2} \cdot (5(1 - t) - e + 2ti \sqrt{3}).\]Then the real part of $d$ is
\[\frac{5(1 - t) - e}{2} - 3t + e = 0.\]Solving for $t$ in terms of $e,$ we find
\[t = \frac{e + 5}{11}.\]Then
\[f = \frac{5(6 - e)}{11} + \frac{2(e + 5) \sqrt{3}}{11} i,\]so
\[f - e = \frac{30 - 16e}{11} + \frac{2(e + 5) \sqrt{3}}{11} i,\]so
\begin{align*}
|f - e|^2 &= \left( \frac{30 - 16e}{11} \right)^2 + \left( \frac{2(e + 5) \sqrt{3}}{11} \right)^2 \\
&= \frac{268e^2 - 840e + 1200}{121}.
\end{align*}This quadratic is minimized when $e = \frac{840}{2 \cdot 268} = \frac{105}{67},$ and the minimum is $\frac{300}{67},$ so the smallest area of the equilateral triangle is
\[\frac{\sqrt{3}}{4} \cdot \frac{300}{67} = }{67}}.\]

First, we find the maximum height of the ball by maximizing the expression $-25t^2+75t+24$. We will do this by completing the square. Factoring a $-25$ from the first two terms, we have  \[-25t^2+75t+24=-25(t^2-3t)+24\]To complete the square, we add and subtract $\left( -\frac{3}{2}\right)^2=\frac{9}{4}$ inside the parentheses to get \begin{align*}
-25(t^2-3t)+24&=-25\left(t^2-3t+\frac{9}{4}-\frac{9}{4}\right)+24\\
&=-25\left(\left(t-\frac{3}{2}\right)^2-\frac{9}{4}\right)+24\\
&=-25\left(t-\frac{3}{2}\right)^2+\frac{225}{4}+\frac{96}{4}\\
&=-25\left(t-\frac{3}{2}\right)^2+\frac{321}{4}
\end{align*}Since $-25\left(t-\frac{3}{2}\right)^2$ is always non-positive, the maximum value of the expression is achieved when $-25\left(t-\frac{3}{2}\right)^2=0$. This happens when $t-\frac{3}{2}=0$. Therefore the height of the ball is at its maximum when $t={2}}$.

